⚠️*Documentos* devem ser ***originais, legíveis e sem borrões***;
    ⚠️*Documentos* devem ser ***obrigatoriamente fotografados***;
    ⚠️*Documentos* fotografados **não poderão** passar por processos de ***edição, manipulação ou tratamento fotográfico*** (*Ex.: alterar brilho, cor, saturação, etc...*);  
    ⚠️Se um *documento* possuir **frente e verso**, deverá ser enviada ***uma única fotografia do documento inteiro*** (*Ex.: RG ou CNH*);
    ⚠️Aceitam-se *documentos* **não fotografados** somente em casos onde os documentos forem ***emitidos digitalmente*** (*Ex.: Carteira Digital de Transito - CNH Digital*);


  **Documentos necessários**:



  Se você for **solteira(o)**, anexe:

* 📃 **Frente e verso** - RG ou CNH ; +
* 📃 Certidão de nascimento; +
* 📃 Documento comprobatório de inscrição no CPF (caso não conste no documento de identificação);



  Se você for **divorciada(o)**, anexe:

* 📃 **Frente e verso** - RG ou CNH ; +
* 📃 Certidão de casamento com divórcio averbado; +
* 📃 Documento comprobatório de inscrição no CPF (caso não conste no documento de identificação);



  Se você for **viúva(o)**, anexe:

* 📃 **Frente e verso** - RG ou CNH ; +
* 📃 Certidão de casamento; +
* 📃 Certidão de óbito do antigo cônjuge; +
* 📃 Documento comprobatório de inscrição no CPF (caso não conste no documento de identificação);



  Se você for **estrangeira(o)**:

* ℹ️ [Clique aqui](https://cartoriocolorado.zendesk.com/hc/pt-br/articles/4405724333083-Casamento-Habilita%C3%A7%C3%A3o-Nubente-estrangeiro-Regra-Geral-Documentos-Nubente-refugiado-Regra-especial)

